      setQuery(e.target.value);
    };

    const handleSearch = () => {
      onSearch(query);
    };

    return (
        <div>
            <Navigation />
            <div>
      <input
        type="text"
        placeholder="Search..."
        value={query}
        onChange={handleInputChange}
      />
